//# sourceMappingURL=vue.min.js.map;var setId;

setId = function() {
  $('#inputsList .form-group:gt(0)').each(function(i, group) {
    $(group).find('label').html('  ' + (i + 2)).attr('for', 'inp_' + (i + 2));
    $(group).find('input').attr('id', 'inp_' + (i + 2));
  });
};

$('#addInput').click(function(e) {
  var cache, list;
  e.preventDefault();
  if ($('#inputsList .form-group').length >= 5) {
    return;
  }
  list = $('#inputsList');
  cache = list.find('.form-group').eq(0).clone();
  cache.insertAfter(list.find('.form-group').eq(-1));
  cache.find('.input').val('');
  cache.find('a').removeClass('none');
  return setId();
});

$('#inputsList').on('click', '.remove-input', function(e) {
  e.preventDefault();
  $(this).parents('.form-group').remove();
  setId();
});
;$(function() {

  /*
  		calculator
   */
  $('.calculator').each(function(i, calc) {
    var dropDisabledClass, input, max, min, minus, plus;
    input = $('input', calc);
    plus = $('.plus', calc);
    minus = $('.minus', calc);
    max = $(calc).data('max' || 99);
    min = $(calc).data('min' || 1);
    dropDisabledClass = function() {
      minus.removeClass('disabled');
      return plus.removeClass('disabled');
    };
    plus.click(function(e) {
      var count;
      count = parseInt(input.val().trim());
      dropDisabledClass();
      if (count < max) {
        count++;
      }
      if (count === max) {
        plus.addClass('disabled');
      }
      return input.val(count);
    });
    minus.click(function(e) {
      var count;
      count = parseInt(input.val().trim());
      dropDisabledClass();
      if (count > min) {
        count--;
      }
      if (count === min) {
        minus.addClass('disabled');
      }
      return input.val(count);
    });
  });
});
