$('.filter-anchor').click(function(e) {
  e.preventDefault();
  $('body').addClass('overlayed');
  $('.aside-filter').addClass('active');
  $('.fader').show();
  setTimeout((function() {
    return $('.fader').addClass('active');
  }), 10);
});

